




 
-----------------------------------------------------------------------------------------------------------------------------------
create table Account (
	accountId INT IDENTITY(1,1) PRIMARY KEY,
	username NVARCHAR(50),
	password NVARCHAR(50),
	fullName NVARCHAR(50),
	email NVARCHAR(50),
	gender NVARCHAR(50),
	phone VARCHAR(50),
	accountRole NVARCHAR(20)
);
create table Location (
	locationId INT IDENTITY(1,1) PRIMARY KEY,
	provinceName NVARCHAR(20),
	districtName NVARCHAR(25),
	streetName NVARCHAR(50)
);
create table RoomType (
	roomTypeId INT IDENTITY(1,1) PRIMARY KEY,
	roomTypeName VARCHAR(50), 
);
create table Room (
	roomId INT IDENTITY(1,1) PRIMARY KEY,
	title NVARCHAR(300),
    [description] NVARCHAR(1000), 
    area int,
	cost float,
	[status] int,
	dateCreated date,
	note NVARCHAR(50),
	locationId int FOREIGN KEY REFERENCES Location(locationId),
	roomTypeId int FOREIGN KEY REFERENCES RoomType(roomTypeId),
	accountId int FOREIGN KEY REFERENCES Account(accountId)
);


create table Image_Room (
	imageId INT IDENTITY(1,1) PRIMARY KEY,
	imageLink NVARCHAR(300),  
	roomId int FOREIGN KEY REFERENCES Room(roomId)
);

create table Fav_Room ( 
	accountId int FOREIGN KEY REFERENCES Account(accountId),  
	roomId int FOREIGN KEY REFERENCES Room(roomId)
);


ALTER TABLE Account
ADD CONSTRAINT UserName UNIQUE (username);



